import NavItem from './NavItem';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const Nav = () => {
    return(
        <Router>
            <Routes>
                <Route path="/"  element={() => (<NavItem url={'/posts'} linkName={'Posts'}/>)} />
                <Route path="/" exact element={() => <NavItem url={'/contact'} linkName={'Contact'}/>} />
                <Route path="/" exact element={() => <NavItem url={'/about'} linkName={'About'}/>} />
            </Routes>
        </Router>
    )
}


export default Nav;
